import { useQuery } from "@tanstack/react-query";
import { request } from "../../utils/axios";

export const useGetUserByUsername = (username) => {

    const { 
        data,
        isFetching
    } = useQuery(['profileUser', { username }], () => 
        request.get('/user/' + username).then(res => res.data[0]));

    return { user: data, isFetchingUser: isFetching }
}
